import sys

def solve():
    n = int(input())
    s = input()
    count = [0, 0]
    for c in s:
        if c == '0':
            count[0] += 1
        else:
            count[1] += 1

    left = 1
    right = (1 << n) - 1
    for i in range(count[1]):
        left *= 2

    for i in range(count[0]):
        right -= (1 << (n - 1 - i))

    print(' '.join(map(str, range(left, right + 1))))

t = 1
while t > 0:
    solve()
    t -= 1
